INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24, 2, 2, 0.0, 102301, 401, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 10046, 24001, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, "アヤネ");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24, 2, 1, 2.21, 102301, 402, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 10046, 24002, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, "アヤネ");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24, 2, 2, 0.0, 102301, 403, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 10046, 24003, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, "アヤネ");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24, 1, 2, 1.99, 192201, 701, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 10046, 24004, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, "アサヒ");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24, 2, 1, 2.21, 192201, 702, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 10046, 24005, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, "アサヒ");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24, 1, 2, 3.33, 192201, 703, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 10046, 24006, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, "アサヒ");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24, 2, 2, 0.0, 192301, 801, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 10046, 24007, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, "部員３");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24, 2, 1, 2.68, 192301, 802, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 10046, 24008, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, "部員３");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24, 2, 2, 0.0, 192301, 803, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 10046, 24009, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, "部員３");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24, 1, 1, 0.0, 192501, 501, "やった！", 10046, 24010, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, "");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24, 1, 1, 0.0, 192501, 502, "勝ったよ！", 10046, 24011, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, "");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24, 1, 1, 0.0, 192501, 503, "いい調子！", 10046, 24012, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, "");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24, 2, 6, 5.33, 113501, 111, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 10046, 24013, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, "ミサト");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24, 2, 1, 6.85, 113501, 112, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 10046, 24014, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, "ミサト");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24, 2, 1, 3.0, 113501, 113, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 10046, 24015, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, "ミサト");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24, 2, 1, 6.11, 192401, 611, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 10046, 24016, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, "ダイチ");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24, 2, 1, 6.75, 192401, 612, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 10046, 24017, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, "ダイチ");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24, 2, 2, 0.0, 192401, 613, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 10046, 24018, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, "ダイチ");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24, 1, 2, 4.52, 113401, 211, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 10046, 24019, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, "ハツネ");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24, 1, 2, 3.89, 113401, 212, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 10046, 24020, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, "ハツネ");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24, 2, 1, 13.49, 113401, 213, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 10046, 24021, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, "ハツネ");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24, 2, 1, 3.17, 106501, 311, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 10046, 24022, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, "カヤ");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24, 2, 1, 4.42, 106501, 312, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 10046, 24023, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, "カヤ");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24, 1, 6, 2.89, 106501, 313, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 10046, 24024, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, "カヤ");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24, 3, 4, 3.71, 102301, 421, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 10046, 24025, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, "アヤネ");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24, 1, 2, 5.1, 192201, 721, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 10046, 24026, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, "アサヒ");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24, 3, 1, 4.34, 192301, 821, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 10046, 24027, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, "部員３");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24, 1, 1, 0.0, 192501, 521, "いい勝負だったよ\nまたやろうね", 10046, 24028, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, "");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24, 2, 1, 5.62, 113501, 101, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 10046, 24029, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, -360.0, "ミサト");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24, 2, 1, 9.58, 113501, 102, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 10046, 24030, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, -360.0, "ミサト");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24, 2, 2, 0.0, 113501, 103, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 10046, 24031, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, -360.0, "ミサト");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24, 1, 2, 9.13, 113501, 104, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 10046, 24032, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, -360.0, "ミサト");
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES (24, 2, 1, 8.27, 113501, 105, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 10046, 24033, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 0.0, -360.0, "ミサト");
